import React from "react";
import ReactDOM from "react-dom";

function chess() {
  return <div class="chess-container"></div>;
}
function meme() {
  return <div class="meme-card"></div>;
}
function App() {
  return (
    <div class="Grid">
      <chess />
      <meme />
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
